    false,nt"url": null,nt"notes": "A first order soil survey was produced
    for a portion of the Pixley  National Wildlife Refuge, Tulare County, California.
    A soil legend  composed of eleven soil map units was established. The dominant  soil
    great groups and their particle size families that were mapped  include coarse-loamy
    Torriorthents, fine-loamy Natrargids, and fine  Natrargids. Soil moisture regime
    at the refuge is aridic and soil  temperature regime is thermic. Underground animal
    burrows  appear to be most abundant in the fine-loamy and fine textured  soils that
    have some vegetative cover. Fewer burrows were  observed in the coarse-loamy soils.",nt"license_title":
